import logo from './logo.svg';
import React, { useEffect } from "react";
import './App.css';
import {audioVisualizer, headerAnimation} from './section_script/sectionScripts.js'

function App() {

  useEffect(() => {

    const header = document.getElementById('App-header-title');
    header.addEventListener('load', headerAnimation);

    return () => {
      header.removeEventListener('load', headerAnimation);
    };
  }, []);

  return (

    <div className="App">
      <header className="App-header"><h1 id="App-header-title"></h1></header>
    </div>
  );
}

export default App;
